import './App.css';
import { NavLink, Routes, Route } from 'react-router-dom';

function App() {
    fetch("http://137.112.104.54:22051/test").then(res => res.text())
    .then(data => console.log("This is the data: " + data))
    .catch(console.log("Error fetching test"));

    return (
        <div className="App">
        <Navigation />
            <Routes>
                <Route exact path="/" Component={Home}/>
                <Route exact path="/about" Component={About}/>
                <Route exact path="/howitworks" Component={HowItWorks}/>
                <Route exact path="/faqs" Component={FAQs}/>
                <Route exact path="/login" Component={Login}/>
                <Route exact path="/signup" Component={Signup}/>
            </Routes>
        </div>
    );
}

const Navigation = () => (
    <nav>
        <NavLink to="/" className="haha"><img src="TextBlock_LogoDark.png" alt="Logo"/></NavLink>
        <NavLink to="/about">About Us</NavLink>
        <NavLink to="/howitworks">How It Works</NavLink>
        <NavLink to="/faqs">FAQs</NavLink>
        <NavLink to="/login">Login</NavLink>
        <NavLink to="/signup">Sign Up</NavLink>
    </nav>
);

const Home = () => (
    <main>
        <h1>Quickly Create & Organize Documents With Module Text Blocks.</h1>
        <h2>A smarter way to build, organize, and refine your documents - flexible, efficient, and intuitive.</h2>
        <NavLink to="/signup">Get Started</NavLink>
    </main>
);

const About = () => (
    <main>
        <h1>About Us</h1>
    </main>
);

const HowItWorks = () => (
    <main>
        <h1>How It Works</h1>
    </main>
);

const FAQs = () => (
    <main>
        <h1>Frequently Asked Questions</h1>
    </main>
);

const FormItem = ({...props}) => (
    <>
        <p><label for=''></label></p>
        <input type={props.type}></input>
    </>
);

const Login = () => (
    <main>
        <h1>Welcome Back</h1>
        <form method='POST' action='/users/login'>

        </form>
        <p>Don't already have an account? <NavLink to="/signup">Sign up</NavLink></p>
    </main>
);

const Signup = () => (
    <main>
        <h1>Welcome to the Text Block Community</h1>
        <form method='POST' action='/users/new'>
            <p><label for='email'>Email</label></p>
            <input type='email' name='email' id='email'></input>
            <p><label for='username'>Username</label></p>
            <input type='text' name='username' id='username' maxLength={20}></input>
        </form>
        <p>Already have an account? <NavLink to="/login">Log in</NavLink></p>
    </main>
);



export default App;
